import Head from 'next/head'

import Navbar from './Navbar'

const Layout = (props) => (
  <>
  <Head>
    <title>SuperHero</title>    
    <link rel="stylesheet" href="../static/PowerBar.css"/>
  </Head>
  <Navbar/>
  {props.children}
  </>
)

export default Layout;
